import React from 'react';
import { StyleSheet, View, Button, Text, Image, Dimensions } from 'react-native';

//====================================================================




//====================================================================
const StorageUnitLowStock = () => {

    return (
        <View style={styles.container}>
            <Text style={styles.text1Styles}>Seafood Freezer</Text>
            <View style={styles.rectangle1Style}><Text>Edit</Text></View>

           
        </View>
    )
}
const deviceWidth = Math.round(Dimensions.get('window').width);
const styles = StyleSheet.create({
    container: {
        backgroundColor: '#FFFFFF',
        alignItems: 'center',
    },
    text1Styles:{
        fontFamily: 'GeneralSans-Bold',
        fontSize: 25,
        color: '#000000',
        fontWeight: 'bold',
    },
    rectangle1Style:{
        backgroundColor: '#000000',
        position: 'absolute',
        width: 30,
        height: 27,
        borderRadius:10
    }
});

export default StorageUnitLowStock;
